var num_qubits = 4;
qc.reset(num_qubits);
var a = qint.new(3, 'a');
var b = qint.new(1, 'b');
// prepare
qc.label('prepare');
a.write(0b111);
b.write(0b0); qc.nop(); qc.label('XOR = CNOT');
qc.nop();
qc.nop();
qc.cnot(0x8, 0x4);
qc.nop();
qc.nop(); qc.label('2の補数');
qc.cnot(0x1|0x2|0x4, 0x8);
qc.cnot(0x4, 0x1|0x2|0x8);
qc.cnot(0x2, 0x1|0x8);
qc.cnot(0x1, 0x8); 初期状態が \(\ket{a = -1 = \textrm{0b111},~b=0=\textrm{0b0}} = \ket{0111} = \ket{7} \) で、終状態が \(\ket{a = 1 = \textrm{0b001},~b=1=\textrm{0b1}} = \ket{1001} = \ket{9} \) となっている。 abs(-1) 1と-1の重ね合わせにabsを適用する場合。 var num_qubits = 4;
qc.reset(num_qubits);
var a = qint.new(3, 'a');
var b = qint.new(1, 'b');
// prepare
qc.label('prepare');
a.write(0);
b.write(0);
qc.nop();
qc.label('｜0〉+｜2〉');
qc.nop();
qc.had(0x2);
qc.nop();
qc.label('subtract(1)');
a.subtract(1);
qc.nop(); qc.label('abs'); qc.cnot(0x8, 0x4); qc.cnot(0x1|0x2|0x4, 0x8);
qc.cnot(0x4, 0x1|0x2|0x8);
qc.cnot(0x2, 0x1|0x8);
qc.cnot(0x1, 0x8); はじめに \(\ket{0}\) と \(\ket{2}\) の重ね合わせを作ってから \(-1\) すると \(\ket{-1} = \ket{7}\) と \(\ket{1}\) の重ね合わせになる。これに abs を適用すると \(\ket{1}=\ket{0001}\) と \(\ket{9}=\ket{1001}\) の重ね合わせになる。このとき、 \(a\) に対応する部分はどちらの状態でも \(001\) で、絶対値は等しい。 (-1と1の重ね合わせを作る方法を思いついたふぇるみうむ氏かしこい！) abs(-1, 1) (ここまで 2021/07/25)
